s($,"bi5","LN",()=>A.a([A.cq("I'm a computer science graduate with a strong interest in cloud computing and app development. I've worked on several academic and personal projects, and I'm passionate about continuous learning and problem-solving.","1. Tell me about yourself."),A.cq("Your company stands out for innovation and employee development. I\u2019m excited by your projects and believe my skills align well with your mission.","2. Why do you want to work here?"),A.cq("I\u2019m a quick learner, good team player, and highly organized. I also adapt quickly to new technologies.","3. What are your strengths?"),A.cq("I used to focus too much on details, but I\u2019ve learned to balance quality with deadlines through prioritization.","4. What is your weakness?"),A.cq("I see myself in a leadership role, contributing to impactful projects and mentoring juniors.","5. Where do you see yourself in 5 years?"),A.cq("I bring a blend of technical skills, enthusiasm, and a proactive mindset. I\u2019m ready to contribute from day one.","6. Why should we hire you?"),A.cq("In a group project, we faced coordination issues. I suggested regular short meetings which helped align the team and meet the deadline.","7. Tell me about a challenge you faced and how you overcame it."),A.cq("Yes, I\u2019m open to relocation for the right opportunity.","8. Are you willing to relocate?"),A.cq("Yes, if the role requires it, I\u2019m flexible with timings.","9. Are you comfortable working night shifts or weekends?"),A.cq("Solving problems, learning new things, and achieving goals keep me motivated.","10. What motivates you?"),A.cq("A collaborative, supportive, and innovative environment with growth opportunities.","11. Describe your ideal work environment."),A.cq("I break tasks into smaller parts, prioritize, and stay calm under pressure.","12. How do you handle stress?"),A.cq("I'm open to a fair offer based on the industry standards and my skills.","13. What are your salary expectations?"),A.cq("You are a leader in your industry, known for innovation and strong company culture.","14. What do you know about our company?"),A.cq("I\u2019m looking for growth opportunities and to expand my skill set in a more dynamic environment.","15. Why did you leave your last job?"),A.cq("I list tasks by urgency and importance, then allocate time accordingly.","16. How do you prioritize your work?"),A.cq("Reliable.","17. Describe yourself in one word."),A.cq("I\u2019m comfortable with both, but I enjoy teamwork for idea-sharing and collaboration.","18. Do you prefer working alone or in a team?"),A.cq("I welcome feedback as a tool for growth and improvement.","19. How do you handle feedback?"),A.cq("I led a team of 4 during a final-year project, delegating tasks and ensuring timely delivery.","20. Tell me about your leadership experience."),A.cq("To become a subject-matter expert and take on more responsibility in tech leadership roles.","21. What are your career goals?"),A.cq("Once, I missed a deadline due to poor estimation. I learned to plan better and buffer time for reviews.","22. Describe a time you failed."),A.cq("I listen to both sides calmly, encourage open communication, and work towards a solution.","23. How do you handle conflict in a team?"),A.cq("My blend of technical skill, creativity, and empathy makes me a well-rounded contributor.","24. What makes you unique?"),A.cq("I enjoy reading, fitness, and working on personal coding projects.","25. What do you do outside of work?"),A.cq("Yes, I\u2019m exploring options but your company is one of my top choices.","26. Are you applying to other companies?"),A.cq("I can join immediately / after serving my notice period (as applicable).","27. How soon can you join?"),A.cq("Clear communication, constructive feedback, and support for growth.","28. What do you expect from a manager?"),A.cq("I\u2019ll take the experience positively, work on my areas of improvement, and keep applying.","29. What will you do if you\u2019re not selected?"),A.cq("Achieving goals while growing personally and professionally.","30. How do you define success?"),A.cq("Work, because meaningful work leads to long-term rewards.","31. What do you value more \u2013 work or money?"),A.cq("I plan ahead, break tasks into milestones, and regularly track progress.","32. How do you manage deadlines?"),A.cq("During a college fest, I stayed late to help finish a project that wasn\u2019t mine to ensure the event's success.","33. Tell me about a time you went above and beyond."),A.cq("I follow tech blogs, attend webinars, and experiment with new tools.","34. How do you stay updated with technology?"),A.cq("Not serious ones. I believe in resolving misunderstandings through open communication.","35. Have you ever had a conflict with a boss?"),A.cq("One that values innovation, collaboration, and continuous learning.","36. What kind of work culture are you looking for?"),A.cq("Yes, I\u2019ve achieved several goals so far, and I\u2019m excited for what\u2019s next.","37. Do you consider yourself successful?"),A.cq("Yes, I stay calm, focus on the task, and deliver quality results.","38. Can you work under pressure?"),A.cq("I like coding, reading tech blogs, and playing badminton.","39. What are your hobbies?"),A.cq("Yes, can you tell me more about the team I\u2019ll be working with and growth opportunities here?","40. Do you have any questions for me?")],A.aw("I<kV>")))
s($,"biK","aPa",()=>A.a([A.f_("I led a team for a college project with tight deadlines. I delegated tasks based on strengths, and we successfully delivered the project on time with high grades.","1. Tell me about a time you led a team. What was the outcome?"),A.f_("I listen to both parties, understand their views, and facilitate a solution that aligns with team goals.","2. How do you handle conflicts within a team?"),A.f_("Yes, during a hackathon, I had to pivot the project idea due to technical issues. The decision helped us complete on time.","3. Have you ever had to make a tough decision under pressure?"),A.f_("I use a priority matrix and time-blocking method to handle high-impact tasks first.","4. How do you prioritize multiple tasks or projects with tight deadlines?"),A.f_("I once micromanaged too much and it delayed progress. I learned to trust the team and delegate better.","5. Describe a situation where you failed as a leader. What did you learn?"),A.f_("By recognizing efforts, setting clear short-term goals, and encouraging collaboration.","6. How do you motivate your team during difficult times?"),A.f_("Yes, I respectfully presented data to support my perspective, and we reached a mutual understanding.","7. Have you ever disagreed with your manager? How did you handle it?"),A.f_("I understand their challenges, offer support or mentoring, and set clear performance expectations.","8. How do you deal with underperforming team members?"),A.f_("I follow a collaborative and adaptive style, depending on team maturity and project needs.","9. What\u2019s your management style?"),A.f_("By setting clear goals, tracking progress, and having regular check-ins.","10. How do you ensure your team stays productive and focused?"),A.f_("During an internship, the project scope changed. I quickly reallocated resources and adjusted the timeline.","11. Describe a time when you had to adapt quickly to change."),A.f_("I stay organized, break tasks into steps, and stay calm under pressure to guide my team.","12. How do you handle stress and pressure in a managerial role?"),A.f_("I align everyone to a common goal, communicate transparently, and offer compromises.","13. How do you manage stakeholders with conflicting interests?"),A.f_("Yes, I prioritized core functionalities and reused components efficiently.","14. Have you handled a project with limited resources? How?"),A.f_("I took responsibility, analyzed the gaps, and implemented a better tracking process for the future.","15. Tell me about a time when your team failed to deliver. What did you do?"),A.f_("By being honest, consistent, and supporting their growth.","16. How do you build trust with your team?"),A.f_("I set SMART goals and regularly communicate updates and feedback.","17. How do you communicate goals and expectations to your team?"),A.f_("Regular retrospectives, upskilling opportunities, and performance reviews.","18. What steps do you take to improve team performance continuously?"),A.f_("I use past experience, discuss with peers, and choose the most logical option with least risk.","19. How do you handle decision-making when data is limited?"),A.f_("I aim to lead cross-functional teams and contribute to strategic decision-making.","20. Where do you see yourself as a leader in 5 years?")],A.aw("I<l2>")))
